// O código deve retornar um array de itens.
// Como precisamos de 2 saídas, retornaremos um array com 2 objetos de item.

// 1. Obter o número de telefone de entrada
// A entrada está no formato do primeiro item (index 0)
const numeroCompleto = $input.first().json.body.message.sender_pn;

// 2. Definir o DDD (os primeiros 2 dígitos)
const ddd = numeroCompleto.substring(0, 2);

// 3. Definir o número original sem o DDD
const numeroSemDdd = numeroCompleto.substring(2);

// 4. Inicializar as variáveis para as saídas
let numero10Digitos;
let numero11Digitos;

// 5. Normalizar o número
if (numeroSemDdd.length === 8) {
    // Caso de entrada com 10 dígitos (Ex: 1188888888)
    // Saída de 10 dígitos: Mantém como está
    numero10Digitos = ddd + numeroSemDdd;

    // Saída de 11 dígitos: Adiciona o '9' após o DDD
    numero11Digitos = ddd + '9' + numeroSemDdd;

} else if (numeroSemDdd.length === 9) {
    // Caso de entrada com 11 dígitos (Ex: 11988888888)
    // Saída de 11 dígitos: Mantém como está
    numero11Digitos = ddd + numeroSemDdd;

    // Saída de 10 dígitos: Remove o primeiro dígito do número (que deve ser o '9')
    // Usamos `slice(1)` para remover o primeiro caractere da string.
    const numeroSemNove = numeroSemDdd.slice(1);
    numero10Digitos = ddd + numeroSemNove;

} else {
    // Caso de erro ou formato inesperado
    console.error("Número de telefone com formato inesperado:", numeroCompleto);
    // Para evitar que o workflow pare, vamos apenas usar o número original em ambas as saídas
    numero10Digitos = numeroCompleto;
    numero11Digitos = numeroCompleto;
}

// 6. Criar os dois itens de output
const outputItem1 = {
    json: {
        telefone_10_digitos: numero10Digitos
    }
};

const outputItem2 = {
    json: {
        telefone_11_digitos: numero11Digitos
    }
};

// 7. Retornar o array de itens
return [outputItem1, outputItem2];

